import { Box, Icon } from '@mui/material';
import naver_button from './naver_button.svg';

const NaverIcon = () => {
  return (
    <Icon
      sx={{
        marginTop: '-10px',
        width: '20px',
        height: '20px',
      }}
    >
      <Box
        component="img"
        src={naver_button}
        sx={{
          width: '20px',
          height: '20px',
        }}
      />
    </Icon>
  );
};

export default NaverIcon;
